import React from 'react'
import "../node_modules/bootstrap/dist/css/bootstrap.min.css"
import Button from 'react-bootstrap/Button';
const Service = () => {
  return (
    <>
      <Button variant="dark">Dark</Button>
    </>
  );
}

export default Service;
